class Exercise {
    constructor(title, fields) {
        this.title = title
        this.fields = fields
    }
}

export const exerciseOne = [
    new Exercise("i", [
            {
                response: 0,
            },
            {
                response: 1,
            },
            {
                response: 2,
            },
            {
                response: 3,
            },
            {
                response: 4,
            }
        ]
    ),
    new Exercise("console", [
            {
                response: 0,
            },
            {
                response: 1,
            },
            {
                response: 2,
            },
            {
                response: 3,
            },
            {
                response: 4,
            },
        ]
    ),
    new Exercise("condition", [
            {
                response: true,
            },
            {
                response: true,
            },
            {
                response: true,
            },
            {
                response: true,
            },
            {
                response: false,
            }
        ]
    ),
]

export const execiseTwo = [
